var AreaList []city

// 甲类地区
var AClassArea = "上海 北京 深圳 广州"

// 乙类地区
var BClassArea = "成都 杭州 重庆 西安 苏州 武汉 南京 天津 郑州 长沙 东莞 佛山 宁波 青岛 沈阳 济南 石家庄 长春 哈尔滨 沈阳 呼和浩特 乌鲁木齐 兰州 银川 太原 西安 郑州 合肥 南京 杭州 福州 广州 南昌 海口 南宁 贵阳 长沙 武汉 成都 昆明 拉萨 西宁 天津 上海 重庆 北京"

// 丙类地区
var CClassArea = "厦门 三亚 大连"

var cidyMap = map[string]string{}

type city struct {
	CityName string
	FixName  string
	Level    string
}

func initAreaList() {
	cMap := map[string]struct{}{}

	cityList := spList(AClassArea, "甲类地区")
	for _, v := range cityList {
		_, ex := cMap[v.CityName]
		if ex {
			continue
		}
		cMap[v.CityName] = struct{}{}
		AreaList = append(AreaList, v)
	}

	cityList = spList(BClassArea, "乙类地区")
	for _, v := range cityList {
		_, ex := cMap[v.CityName]
		if ex {
			continue
		}
		cMap[v.CityName] = struct{}{}
		AreaList = append(AreaList, v)
	}

	cityList = spList(CClassArea, "丙类地区")
	for _, v := range cityList {
		_, ex := cMap[v.CityName]
		if ex {
			continue
		}
		cMap[v.CityName] = struct{}{}
		AreaList = append(AreaList, v)
	}
}

func spList(r string, level string) []city {
	var result []city
	pMap := map[string]struct{}{}
	c := strings.Split(r, " ")

	for _, v := range c {
		_, ex := pMap[v]
		if ex {
			continue
		}

		pMap[v] = struct{}{}
		result = append(result, city{CityName: v, Level: level})
	}

	return result
}

func main() {
	log.SetFlags(log.LstdFlags | log.Llongfile)

	initAreaList()
	cidyMap = queryID()

	top := []string{"2", "3", "4", "5"}

	for _, v := range AreaList {
		for _, tp := range top {
			model, err := reptileP(v.CityName, cidyMap[v.CityName], tp)
			if err != nil {
				log.Fatalln(err)
				return
			}
			err = writeFile(model, v, tp)
			if err != nil {
				log.Fatalln(err)
			}
		}
	}
}

func writeFile(js *models.JSModel, ct city, tp string) error {
	fileName := fmt.Sprintf("%s_%s_%s星_%.2f均价_%d中位数.csv", ct.Level, ct.CityName, tp, js.AveragePrice, js.Median)
	if ct.Level == "甲类地区" {
		fileName = filepath.Join("a_class", fileName)
	} else if ct.Level == "乙类地区" {
		fileName = filepath.Join("b_class", fileName)
	} else {
		fileName = filepath.Join("c_class", fileName)
	}
	create, err := os.Create(fileName)
	if err != nil {
		return err
	}
	defer create.Close()
	writer := csv.NewWriter(create)
	defer writer.Flush()

	for _, v := range js.Hotels {
		writer.Write([]string{v.Hotelname, v.BusinessZoneName, v.DistrictName, v.Address, v.Url, strconv.Itoa(v.ShowPrice)})
	}

	return nil
}

func reptileP(cityName string, cityID string, rank string) (*models.JSModel, error) {
	var i int
	for {
		rand.Seed(time.Now().UnixNano())
		time.Sleep(time.Millisecond * time.Duration(rand.Intn(100)))
		model, err := reptile(cityName, cityID, rank)
		if err == nil {
			return model, nil
		}
		i += i
		time.Sleep(time.Second * 3)
		fmt.Println("重试: ", i, "    ", cityName, "  ", rank, "  ", cityID)
	}
}

func reptile(cityName string, cityID string, rank string) (*models.JSModel, error) {
	u := "https://www.zhuna.cn/hotel/listAjax"
	code, respBody, err := urllib.Get(u).RandUserAgent().SetTimeout(time.Second*12).Queries("city_name", cityName).
		Queries("cityid", cityID).Queries("tm1", "2021-10-29").Queries("tm2", "2021-10-30").
		Queries("type", "keyword").Queries("rank", rank).Queries("page", "1").Byte()
	if err != nil {
		return nil, err
	}

	if code != 200 {
		return nil, errors.New(string(respBody))
	}

	var result models.JSModel
	err = json.Unmarshal(respBody, &result)
	if err != nil {
		return nil, err
	}

	return result.AvgPrice().MedianPrice(), nil
}

