func queryID() map[string]string {
	result := map[string]string{}

	dom, err := goquery.NewDocumentFromReader(strings.NewReader(pxHtml))
	if err != nil {
		log.Fatalln(err)
	}

	dom.Find("a").Each(func(i int, selection *goquery.Selection) {
		attr, exists := selection.Attr("_cityid")
		if !exists {
			return
		}
		//fmt.Println(attr, "  ", selection.Text())
		result[selection.Text()] = attr
	})

	return result
}
